import React from 'react';
import { Container, Row, Col, ListGroup } from 'react-bootstrap';

const EducationalBackground = () => {
  return (
    <div>
      <Container>
        <h2>My Education</h2>
        <ListGroup>
          <ListGroup.Item>
            <h5>Academic Gymnasiym â„–56 </h5>
            <p>infomat degree - 2022</p>
            <p>This degree has a profile algebra, geometry, ICT, phisics, russian language, english language. Mainly i have grades 4, but algebra and ICS have grade 5</p>
          </ListGroup.Item>
          <ListGroup.Item>
            <h5>Hameenlinan University of Applied Sciences</h5>
            <p>Computer Application - 2025</p>
            <p>Learning basic languages of programming. Upgrading skills of teambuilding.</p>
          </ListGroup.Item>
          </ListGroup>
      </Container>
    </div>
  );
}

export default EducationalBackground;
